<div> 
<div className={`sidebar ${isOpen ? "open" : ""}`}>
          <button
            onClick={toggleSidebar}
            className="sidebar-toggle "
          >
            {isOpen ? <FaEye/> : "menu"}
          </button>
      
  
          <nav>
<FaEye/>
<label>name</label>
<input type='text'/>            
            
          </nav>
</div>     
   </div>

    );
}
export default Profile
